import React from 'react'
import {useParams} from 'react-router-dom'

function Info() {
  let params = useParams();
  let login = params.login;

 

  return (
    <div>
      {
         fetch(`https://api.github.com/users/${login}`)
         .then(response => {
             return response.json();
         })
         .then(data => (
             infos = data
          ))
      }
    </div>
  )
}

export default Info
